ra que los numeros aleaotorios que obtengamos sean los mismos, aun si\n","            #los ejecutamos en un entorno diferento o equipo.\n","n <- 8 #Numero de variables\n","mu <- c(runif(n,1,8)) # vector de Medias\n","A <- matrix(runif(n^2)*2-1, ncol=n) # Matriz de Datos, generando valores en un intervalo [-1,1]\n","sigma <- (t(A) %*% A)*1/n #Matriz por propiedad algebraica\n","\n","datos <- mvrnorm(1000, mu=mu,Sigma=sigma)"]},{"cell_type":"markdown","id":"64b1131d","metadata":{"papermill":{"duration":0.004833,"end_time":"2023-10-15T00:11:16.763663","exception":false,"start_time":"2023-10-15T00:11:16.75883","status":"completed"},"tags":[]},"source":["**Checamos si la matriz Sigma es simetrica**"]},{"cell_type":"code","execution_count":5,"id":"4f0b21a9","metadata":{"execution":{"iopub.execute_input":"2023-10-15T00:11:16.780479Z","iopub.status.busy":"2023-10-15T00:11:16.776682Z","iopub.status.idle":"2023-10-15T00:11:16.829867Z","shell.execute_reply":"2023-10-15T00:11:16.828121Z"},"papermill":{"duration":0.06628,"end_time":"2023-10-15T00:11:16.834608","exception":false,"start_time":"2023-10-15T00:11:16.768328","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["TRUE"],"text/latex":["TRUE"],"text/markdown":["TRUE"],"text/plain":["[1] TRUE"]},"metadata":{},"output_type":"display_data"}],"source":["isSymmetric(sigma)"]},{"cell_type":"markdown","id":"ca947d87","metadata":{"papermill":{"duration":0.004984,"end_time":"2023-10-15T00:11:16.853636","exception":false,"start_time":"2023-10-15T00:11:16.848652","status":"completed"},"tags":[]},"source":["**Checamos si la matriz sigma es semidefinida positva**"]},{"cell_type":"code","execution_count":6,"id":"17734253","metadata":{"execution":{"iopub.execute_input":"2023-10-15T00:11:16.86705Z","iopub.status.busy":"2023-10-15T00:11:16.865435Z","iopub.status.idle":"2023-10-15T00:11:16.892478Z","shell.execute_reply":"2023-10-15T00:11:16.888267Z"},"papermill":{"duration":0.038308,"end_time":"2023-10-15T00:11:16.896988","exc