":420}},"output_type":"display_data"}],"source":["#Variables constantes (varianza cero)\n","varCero <- names(which(diag(var(df[,numericas]) == 0)))\n","\n","#Estructura de correlacion\n","correlacion <- cor(df[,numericas], method=\"pearson\") #matriz de correlacion\n","\n","#prueba de significancia\n","p.mat <- corrplot::cor.mtest(df[,numericas])\n","\n","#Mapa de calor\n","corrplot::corrplot(correlacion, \n","                   method=\"color\", \n","                   type=\"upper\", \n","                   order=\"hclust\", \n","                   addCoef.col = \"black\", \n","                   diag=FALSE, \n","                   number.cex = 0.5,\n","                   #Text label color and rotattion\n","                   tl.col = \"black\",tl.srt = 45, family=\"Ubuntu Condensed\",\n","                   #Combine with significance\n","                   p.mat = p.mat$p, sig.level = 0.01, insig = \"blank\")\n","\n","#Clusterizacion en correlacion\n","dd <- as.dist((1-cor(df[,numericas]))/2)\n","plot(hclust(dd), family=\"Ubuntu Condensed\");grid() # To see a dendogram of clustered variables"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":81.474899,"end_time":"2023-10-15T00:11:59.448242","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-10-15T00:10:37.973343","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}